import React from 'react';

const MovieItem = ({ movie }) => {
    return (
        <div>
            <img src={`https://image.tmdb.org/t/p/w185_and_h278_bestv2${movie.poster_path}`} alt={movie.original_title} />
            <h3>{movie.title}</h3>
        </div>
    )
};

export default MovieItem;
